function emitteHeartsTo(x, y, xDest, yDest, typeParticle){
    var emitter = game.add.group();   
    emitter.create(x,y, 'atlas', typeParticle)
    emitter.create(x,y+17, 'atlas', typeParticle)
    emitter.create(x,y+34, 'atlas', typeParticle)
    emitter.setAll('scale.x', 0);
    emitter.setAll('scale.y', 0);
    emitter.setAll('anchor.x', 0.5);
    emitter.setAll('anchor.y', 0.5);
    var index = 0

    emitter.forEach(function(particle){ 
        this.game.add.tween(particle.scale).to({ x: 0.5, y: 0.5},450,Phaser.Easing.Sinusoidal.Out, true);
    });

    setTimeout(function(){          
        emitter.forEach(function(particle){ 
            index++
            var tw = self.game.add.tween(particle).to({ x: xDest, y: yDest},(index*300),Phaser.Easing.Sinusoidal.Out, true);      
            tw.onComplete.addOnce(function(){ particle.kill(); }, this);}, this);
    }, 1500);
}

function emitteCoinsTo(x, y, xDest, yDest, quantity, typeParticle){
    var emitter = game.add.group(); 
    emitter.create(x+5,y, 'atlas', typeParticle)
    emitter.create(x-10,y-5, 'atlas', typeParticle)
    emitter.create(x+8,y-10, 'atlas', typeParticle)
    emitter.create(x,y+8, 'atlas', typeParticle)
    emitter.create(x,y, 'atlas', typeParticle)
    emitter.create(x-14,y+20, 'atlas', typeParticle)
    emitter.create(x+15,y-2, 'atlas', typeParticle)
    emitter.create(x+20,y, 'atlas', typeParticle)
    emitter.setAll('scale.x', 0.35);
    emitter.setAll('scale.y', 0.35);
    emitter.setAll('anchor.x', 0.5);
    emitter.setAll('anchor.y', 0.5);
    var index = 0

    setTimeout(function(){          
        emitter.forEach(function(particle){ 
            index++
            var tw = self.game.add.tween(particle).to({ x: xDest, y: yDest},(index*200),Phaser.Easing.Sinusoidal.Out, true);      
            tw.onComplete.addOnce(function(){ particle.kill();this.blackholeSFX.play()}, this);}, this);
    }, 250);
}

