function autoRobotClick(){
    if(this.timeFrozen && this.timeFrozen == true) return
    if(this.clientsRobotGroup.length  == 0 && this.clientsRobotGroup2.length == 0) return
    var picks = null
    var nextDisheToSelect = null
    var client1 = this.clientsRobotGroup.iterate('visible', true, Phaser.Group.RETURN_CHILD);
    var client2 = this.clientsRobotGroup2.iterate('visible', true, Phaser.Group.RETURN_CHILD);

    if(client1 && client2){
        if(client1.happiness < client2.happiness)
            nextDisheToSelect = client1.valueType
        else
            nextDisheToSelect = client2.valueType
    }

    if(nextDisheToSelect){
        if(nextDisheToSelect == this.dishesRobot1.valueType)
            picks = this.dishesRobot1
        else
            picks = this.dishesRobot2
    }
    else{
        picks = this.lastRobotDishe
    }


    this.onClickDishes(picks)
}

