function removeClientToGroup(groupClients, dishe, client, isPlayer){
    dishe.alpha = 0
    client.animationState.setAnimation(0, 'Happy', true);
    game.add.tween(dishe).to({ alpha: 1 },600,Phaser.Easing.Linear.None,true);
    this.emitDisheTo(dishe.x,dishe.y,client.bubble.world.x,client.bubble.world.y,client.valueType)
    client.width *= -1
    
    var t = game.add.tween(client).to({ x: (window.innerWidth)*window.devicePixelRatio },800,Phaser.Easing.Linear.None,true);
    game.add.tween(client.bubble).to({ alpha: 0},650,Phaser.Easing.Linear.None,true);
    
    t.onComplete.add(function(){
        groupClients.remove(client,true)
        if(isPlayer)
            this.game.time.events.add(500,this.SpawnPlayerClients)
        else
            this.game.time.events.add(500,this.SpawnRobotClients)
    }) 


    if(isPlayer){
        var score = this.rnd.between(2,30)
        var me = this
        var pointsTween = me.game.add.tween(me);
        pointsTween.to({ playerScore: playerScore+score}, 200, Phaser.Easing.Linear.None, true, 200);
        this.scaleSprite(this.hudPlayerPoints, this.game.width, this.game.height/3, 0 ,0.55)
        this.scaleyoyo(this.hudPlayerPoints, this.game.width, this.game.height/3, 0 ,0.5)

        pointsTween.onUpdateCallback(function(){
            me.hudPlayerPoints.setText(Math.floor(me.playerScore));
        }, this);
            me.updatePlayerScoreBars()

        pointsTween.onComplete.addOnce(function(){
            me.whoIsWinning()
            me.hudPlayerPoints.setText(Math.floor(me.playerScore));
        }, this); 
        //this.game.time.events.add(500,function(){this.canTap = true;})    
    }else{
        var score = this.rnd.between(2,30)
        var me = this
        var pointsTween = me.game.add.tween(me);
        pointsTween.to({ robotScore: robotScore+score}, 200, Phaser.Easing.Linear.None, true, 200);
        this.scaleSprite(this.hudRobotPoints, this.game.width, this.game.height/3, 0 ,0.55)
        this.scaleyoyo(this.hudRobotPoints, this.game.width, this.game.height/3, 0 ,0.5)
        pointsTween.onUpdateCallback(function(){
            me.hudRobotPoints.setText(Math.floor(me.robotScore));
        }, this);
            me.updateRobotScoreBars()

        pointsTween.onComplete.addOnce(function(){
            me.whoIsWinning()
            me.hudRobotPoints.setText(Math.floor(me.robotScore));
        }, this);           
        this.game.time.events.add(200,function(){this.canTapR = true;})
    }
}

function onClickDishes(dishe){
    if(!this.canTapR) return
    this.canTapR = false
    this.hasBotRemoved = false

    var client1 = this.clientsRobotGroup.iterate('valueType', dishe.valueType, Phaser.Group.RETURN_CHILD);
    var client2 = this.clientsRobotGroup2.iterate('valueType', dishe.valueType, Phaser.Group.RETURN_CHILD);

    if(client1 && client2){
        this.hasBotRemoved = true
        if(client1.happiness < client2.happiness)
            this.removeClientToGroup(this.clientsRobotGroup,dishe,client1,false)
        else
            this.removeClientToGroup(this.clientsRobotGroup2,dishe,client2,false)
    }

    if(!this.hasBotRemoved){
        if(client1){
            this.removeClientToGroup(this.clientsRobotGroup,dishe,client1,false)
        }
        else if(client2){
            this.removeClientToGroup(this.clientsRobotGroup2,dishe,client2,false)
        }
    }
    this.hasBotRemoved = false
}

function onClickPlayerDishes(dishe){
    //if(!this.canTap) return
    if(this.hand)this.hand.alpha = 0

    this.countLastDishes++
    
    if(this.countLastDishes >=2){
        this.startGameRoutine3()

        if(!this.isFirstSkillActivated || this.timeToSecondSkill){
            this.isTutorialSkill = false
            showSkillHand()
        }
    }

    var client1 = this.clientsPlayerGroup.iterate('valueType', dishe.valueType, Phaser.Group.RETURN_CHILD);
    var client2 = this.clientsPlayerGroup2.iterate('valueType', dishe.valueType, Phaser.Group.RETURN_CHILD);
    
    this.hasPlayerRemoved = false

    if(client1 && client2){
        this.hasPlayerRemoved = true
        if(client1.happiness < client2.happiness)
            this.removeClientToGroup(this.clientsPlayerGroup,dishe,client1,true)
        else
            this.removeClientToGroup(this.clientsPlayerGroup2,dishe,client2,true)
    }

    if(!this.hasPlayerRemoved){
        if(client1){
            this.removeClientToGroup(this.clientsPlayerGroup,dishe,client1,true)
        }
        else if(client2){
            this.removeClientToGroup(this.clientsPlayerGroup2,dishe,client2,true)
        }
    }
    this.disheSFX.play()
    this.canTap = false
    this.hasPlayerRemoved = false
}

function emitDisheTo(x, y, xDest, yDest, typeName){
    var dishe = this.game.add.sprite(x, y, 'atlas',typeName);   
    dishe.anchor.set(0.5);
    this.scaleSprite(dishe, this.game.width/3, this.game.height, 0 ,0.3)
    this.scaleSpriteTween(dishe, this.game.width/3, this.game.height, 0 ,0.2)

    var tw = dishe.game.add.tween(dishe).to({ x: xDest, y: yDest},300,Phaser.Easing.Sinusoidal.Out, true);      
    tw.onComplete.addOnce(function(){ dishe.kill(); }, this);
}

function whoIsWinning(){
    if(this.playerScore > this.robotScore){
        this.hudArrowLeft.alpha = 1;
        game.add.tween(this.hudArrowLeft).to({ alpha: 0},400,Phaser.Easing.Sinusoidal.InOut,true).repeat(2);
            this.hudAvatarRobotFire.alpha = 0
            this.hudAvatarPlayerFire.alpha = 1
    }
    else{
        this.hudArrowRight.alpha = 1;
        game.add.tween(this.hudArrowRight).to({ alpha: 0},400,Phaser.Easing.Sinusoidal.InOut,true).repeat(2);
            this.hudAvatarRobotFire.alpha = 1
            this.hudAvatarPlayerFire.alpha = 0
    }
}

function updatePlayerScoreBars(){
    if(this.mask.x >= this.game.width*0.2) return
    var step = (this.playerScore*0.4);
    this.mask.x += step
    //game.add.tween(this.mask).to({ x:step}, 400, Phaser.Easing.Elastic.In).start();
    var step2 =  (this.playerScore*0.4);
    this.mask2.x += step2
    //.add.tween(this.mask2).to({ x:step2}, 400, Phaser.Easing.Elastic.In).start();
    var stepS =  (this.playerScore*0.4)
    //game.add.tween(this.separator).to({ x:stepS}, 200, Phaser.Easing.Sinusoidal.In).start();
    this.separator.x += stepS
   // this.hudArrowLeft.x = this.separator.x - this.hudArrowLeft.width*0.65
}

function updateRobotScoreBars(){
    if(this.mask2.x <= -this.game.width*0.2) return
    var step = (this.robotScore*0.4);
    this.mask.x -= step

    //game.add.tween(this.mask).to({ x:step}, 400, Phaser.Easing.Elastic.Out).start();
    var step2 =  (this.robotScore*0.4);
    this.mask2.x -= step2

    //game.add.tween(this.mask2).to({ x:step2}, 400, Phaser.Easing.Elastic.Out).start();
    var stepS =  (this.robotScore*0.4)
    //game.add.tween(this.separator).to({ x:stepS}, 200, Phaser.Easing.Sinusoidal.In).start();
    this.separator.x -= stepS

    //this.hudArrowRight.x = this.separator.x - this.hudArrowRight.width*0.65
}

function tick(){
 //subtract a second
    this.timeInSeconds--;
    var minutes = Math.floor(this.timeInSeconds / 60);
    //find the number of seconds left
    //not counting the minutes
    var seconds = this.timeInSeconds - (minutes * 60);
    //make a string showing the time
    var timeString = minutes + ":" + this.addZeros(seconds);
    this.clockBg.children[0].text = timeString;
    //check if the time is up
   if(this.timeInSeconds == 18){
        this.timeToSecondSkill = true
        this.handTutorial2 = true
   }
   else if(this.timeInSeconds == 5){
        if(this.playerScore >= this.robotScore){
            this.stealScorePlayer()
            var vfx = this.runVFX('UI_heidong',0.7)
            this.emitteCoinsTo(this.hudPlayerPoints.x, this.hudPlayerPoints.y, vfx.x,vfx.y, 10, 'Universal coin icon.png')
        }
   }
   else if (this.timeInSeconds == 0) {
        this.world.bringToTop(this.darkLight)
        game.add.tween(this.darkLight).to({ alpha: 0.5},800,Phaser.Easing.Sinusoidal.In,true)

        if(this.playerScore < this.robotScore){
            this.defeatText.bringToTop()
            var t = game.add.tween(this.defeatText).to({ y: this.game.height*0.3},800,Phaser.Easing.Sinusoidal.In,true)
        }

        this.timeoutSFX.play()
        this.callCTA()
    }
}

function addZeros(num) {
    if (num < 10) {
        num = "0" + num;
    }
    return num;
}

function callCTA(){
    this.diceBtndummy.inputEnabled = false
    this.hand.alpha = 0
    this.hand2.alpha = 0
    this.clientsPlayerGroup.alpha = 0;
    this.clientsPlayerGroup2.alpha = 0;
    this.clientsRobotGroup.alpha = 0;
    this.clientsRobotGroup2.alpha = 0;
    this.clientsPlayerGroup.setAll('bubble.alpha',0) 
    this.clientsPlayerGroup2.setAll('bubble.alpha',0) 
    this.clientsRobotGroup.setAll('bubble.alpha',0) 
    this.clientsRobotGroup2.setAll('bubble.alpha',0) 

    this.btnDownload.bringToTop()
    game.time.events.stop();
    game.time.events.removeAll()
    game.time.events.remove(this.timer);
    this.timer.removeAll()
    this.timer.stop()
    this.game.input.onDown.add(onClickDownload,this);
    this.btnDownload.bringToTop()
    this.scaleSprite(this.btnDownload, this.game.width, this.game.height/3, 0 ,0.6)
    this.pulse(this.btnDownload, this.game.width, this.game.height/3, 0 ,0.6)
}


